import React from 'react';
import "../hojas-de-estilo/Fot.css";

function Fot(){
    return(
        <div class="attribution" >
            <span>
            Challenge by <a href="https://www.frontendmentor.io?ref=challenge" target="_blank" rel='noreferrer'>Frontend Mentor</a>. 
            Coded by <a href="https://github.com/gabrielveliz" target="_blank" rel='noreferrer'>Gabriel Veliz</a>.
            </span>
        
        </div>
    );
}

export default Fot;
